import React, { Component } from 'react';
import { Text, View, TextInput, Button, FlatList, AsyncStorage, item, TouchableOpacity } from 'react-native';

class ChatScreen extends Component {
  constructor(props) {
    super(props);
    this.state = {
      chats: [],
      error: null,
      chatSearchId: '',
      singleChat: null,
    };
  }

  componentDidMount() {
    this.focusListener = this.props.navigation.addListener('focus', () => {
      this.viewChats();
    });
  }
  
  componentWillUnmount() {
    if (this.focusListener != null && this.focusListener.remove) {
      this.focusListener.remove();
    }
  }
  
  async viewChats() {
    try {
      const response = await fetch('http://localhost:3333/api/1.0.0/chat', {
        method: 'GET',
        headers: {
          'X-Authorization': await AsyncStorage.getItem('whatsthat_session_token'),
          'Content-Type': 'application/json',
        },
      });
      if (response.status === 200) {
        const chats = await response.json();
        this.setState({ chats: chats });
        console.log(this.state.chats);
      } else if (response.status === 401) {
        console.log('Unauthorised');
        await AsyncStorage.removeItem('whatsthat_session_token');
        await AsyncStorage.removeItem('whatsthat_user_id');
        this.props.navigation.navigate('Login');
      } else {
        throw 'Server Error';
      }
    } catch (error) {
      this.setState({ error: error });
    }
  }

  async viewSingleChat(chat_id) {
    try {
      const response = await fetch(`http://localhost:3333/api/1.0.0/chat/${chat_id}`, {
        method: 'GET',
        headers: {
          'X-Authorization': await AsyncStorage.getItem('whatsthat_session_token'),
          'Content-Type': 'application/json',
        },
      });
  
      if (response.status === 200) {
        const chat = await response.json();
        this.setState({ singleChat: chat });
      } else if (response.status === 401) {
        console.log('Unauthorised');
        await AsyncStorage.removeItem('whatsthat_session_token');
        await AsyncStorage.removeItem('whatsthat_user_id');
        this.props.navigation.navigate('Login');
      } else if (response.status === 403) {
        console.log('Forbidden');
      } else if (response.status === 404) {
        console.log('Not Found');
      } else {
        throw 'Server Error';
      }
    } catch (error) {
      this.setState({ error: error });
    }
  }
  
  render() {
    const { chats, singleChat, chatSearchId } = this.state;
    
    return (
      <View>

          <View style={{ flexDirection: 'row', justifyContent: 'space-between', alignItems: 'center', margin: 10 }}>
          <Text style={{ fontSize: 20, fontWeight: 'bold' }}>Chats</Text>
          <TouchableOpacity onPress={() => this.props.navigation.navigate('NewChat')}>
            <Text style={{ color: 'blue', textDecorationLine: 'underline' }}>Create New Chat</Text>
          </TouchableOpacity>
        </View>
        <TextInput
          placeholder="Enter chat ID"
          value={chatSearchId}
          onChangeText={(text) => this.setState({ chatSearchId: text })}
        />
        <Button 
          title="Search" 
          onPress={() => this.viewSingleChat(chatSearchId)}
        />

        {singleChat && ( 
          <View>
            <Text>Chat ID: {singleChat.chat_id}</Text>
            <Text>Chat Name: {singleChat.creator.first_name} {singleChat.creator.last_name}</Text>
          </View>
        )}

        <FlatList
          data={chats}
          renderItem={({ item }) => (
            <View>
              <Text>Chat ID: {item.chat_id}</Text>
              <Text>Chat Name: {item.name}</Text>
              <Text>Creator: {item.creator.first_name} {item.creator.last_name}</Text>
              <Text>Last Message: {item.last_message.message}</Text>
            </View>
          )}
          keyExtractor={(item) => item.chat_id.toString()}
        />
      </View>
    );
  }

}

export default ChatScreen;
